import React, { useState, useEffect } from "react";
import axios from "axios"; // Import the Axios HTTP client

function getShirt() {
  const strShirt = "No Shirt in closet";
  axios
    .get(`http://localhost:5000/api/gets/${"Shirt"}`)
    .then((response) => {
      strShirt = response.data[0].color + " Shirt";
    })
    .catch((error) => {
      console.error(error);
    });
  return strShirt;
}
function getPant() {
  const strPant = "No Pant in closet";
  axios
    .get(`http://localhost:5000/api/gets/${"Pant"}`)
    .then((response) => {
      strShirt = response.data[0].color + " Pant";
    })
    .catch((error) => {
      console.error(error);
    });
  return strPant;
}
export default function Generate() {
  const [data, setData] = useState(0); // Initialize the state variable to hold the data

  const handleClick = () => {
    // Send a GET request to the server to retrieve the data from the database
    setData("You should wear " + getShirt() + " on top of " + getPant()); // Update the state variable with the data
  };
  return (
    <div>
      <button onClick={handleClick}>Get Data</button>
      {data && <textarea value={data} />}{" "}
      {/* Display the data in a textbox if it has been retrieved */}
    </div>
  );
}
